/* eslint-disable react/no-unescaped-entities */
import Octicon, { LogoGithub } from '@githubprimer/octicons-react';
import React from 'react';
import { TopBar, Paper } from '@../../../../reactify/build';
import {
  simpleCode,
} from './code-refrence';
import './top-bar.scss';
import DemoCard from '../../components/demo-card';

const TopBarDemo = () => (
  <div>
    <DemoCard
      title="Simple Use"
      uniqueIdentifier="simpleUse"
      sourceCode={simpleCode}
    >
      <TopBar>
        <TopBar.Logo>
          <Paper success style={{ color: 'white', padding: '0.2em 0.4em', boxShadow: 'none' }} className="logo">reactify ui</Paper>
        </TopBar.Logo>
        <TopBar.Menu>
          <a href="https://github.com">
            <Octicon icon={LogoGithub} size="large" ariaLabel="GitHub" />
          </a>
        </TopBar.Menu>
      </TopBar>
    </DemoCard>

  </div>
);

export default TopBarDemo;
